    // other and return them in order (smaller number, larger number).
    // >>> findClosestElements((new ArrayList<Float>(Arrays.asList((float)1.0f, (float)2.0f, (float)3.0f, (float)4.0f, (float)5.0f, (float)2.2f))))
    // (Pair.with(2.0f, 2.2f))
    // >>> findClosestElements((new ArrayList<Float>(Arrays.asList((float)1.0f, (float)2.0f, (float)3.0f, (float)4.0f, (float)5.0f, (float)2.0f))))
    // (Pair.with(2.0f, 2.0f))
    public static Pair<Float, Float> findClosestElements(ArrayList<Float> numbers) {
        // Sort the list
        Collections.sort(numbers);
        // Get the first two numbers
        Float first = numbers.get(0);
        Float second = numbers.get(1);
        // Get the difference between them
        Float difference = Math.abs(first - second);
        // Loop through the rest of the numbers
        for (int i = 2; i < numbers.size(); i++) {
            // Get the next number
            Float next = numbers.get(i);
            // Get the difference between the current first and next numbers
            Float nextDifference = Math.abs(first - next);
            // If the difference is smaller than the current difference
            if (nextDifference < difference) {
                // Set the second number to the first number
                second = first;
                // Set the first number to the next number
                first = next;
                // Set the difference to the next difference
                difference = nextDifference;
            }
        }
        // Return a pair of the first and second numbers
        return Pair.with(first, second);

