        for (int i = 0; i < numbers.size() - 1; i++) {
            // Add a pair of the current number and the next number to the list of pairs
            pairs.add(new Pair<Float, Float>(numbers.get(i), numbers.get(i + 1)));
        }
        // Sort the list of pairs in ascending order by the difference between the two numbers
        Collections.sort(pairs, (a, b) -> {
            return Float.compare(Math.abs(a.getValue0() - a.getValue1()), Math.abs(b.getValue0() - b.getValue1()));
        });
        // Return the first pair in the list of pairs
        return pairs.get(0);

