    public static ArrayList<Long> removeDuplicates(ArrayList<Long> numbers) {
        ArrayList<Long> result = new ArrayList<Long>();
        for (Long number : numbers) {
            if (!result.contains(number)) {
                result.add(number);
            }
        }
        return result;

