        long apples = 0;
        long oranges = 0;
        for (int i = 0; i < arr.length; i++) {
            if (arr[i].equals("apples")) {
                apples = Long.parseLong(arr[i - 1]);
            }
            if (arr[i].equals("oranges")) {
                oranges = Long.parseLong(arr[i - 1]);
            }
        }
        return n - (apples + oranges);

