        ArrayList<String> ret = new ArrayList<String>();
        for (String s : lst) {
            int count = 0;
            for (int i = 0; i < s.length(); i++) {
                if (Integer.parseInt(s.charAt(i) + "") % 2 == 1) {
                    count++;
                }
            }
            ret.add("the number of odd elements " + count + "n the str" + count + "ng " + count + " of the " + count + "nput.");
        }
        return ret;

