        ArrayList<Integer> sum = new ArrayList<Integer>();
        for(int i = 0; i < nums.size(); i++) {
            long num = nums.get(i);
            int sum_num = 0;
            while(num > 0) {
                sum_num += num % 10;
                num /= 10;
            }
            sum.add(sum_num);
        }
        ArrayList<Integer> index = new ArrayList<Integer>();
        for(int i = 0; i < nums.size(); i++) {
            index.add(i);
        }
        ArrayList<Integer> index_result = new ArrayList<Integer>();
        for(int i = 0; i < nums.size(); i++) {
            int min_index = 0;
            int min_sum = sum.get(0);
            for(int j = 0; j < sum.size(); j++) {
                if(sum.get(j) < min_sum) {
                    min_index = j;
                    min_sum = sum.get(j);
                }
            }
            index_result.add(index.get(min_index));
            sum.remove(min_index);
            index.remove(min_index);
        }
        for(int i = 0; i < nums.size(); i++) {
            result.add(nums.get(index_result.get(i)));
        }
        return result;

